import React from "react";
import Link from "next/link";
<script async defer crossorigin="anonymous" src="https://connect.facebook.net/vi_VN/sdk.js#xfbml=1&version=v16.0" nonce="jaGAyce0"></script>
import SocialIcons from "../../other/SocialIcons";

export default function FooterFanpage() {
    return (
        <div className="footer-links">
            <Row gutter={4} justify="space-between">
                <h5>Fanpage</h5>
                <div class="fb-page" data-href="https://www.facebook.com/ddongdoi.nghichcanh" data-tabs="fanpage" data-width="300" data-height="400" data-small-header="false" data-adapt-container-width="true" data-hide-cover="false" data-show-facepile="true"><blockquote cite="https://www.facebook.com/ddongdoi.nghichcanh" class="fb-xfbml-parse-ignore"><a href="https://www.facebook.com/ddongdoi.nghichcanh">Lữ Văn Kỳ</a></blockquote></div>
            </Row>
        </div>
    );
}
